    "http://res.cloudinary.com/jkeohan/image/upload/v1535732381/day.svg"
  ];

  return (
    <div>
      <div>
        <h1>My WeatherIcons App</h1>
      </div>
      <div>
        {weatherData.map((wd) => (
          <div key={wd.img}>{wd.img}</div>
        ))}
        {weatherData.map((wd) => (
          <div key={wd.conditions}>{wd.conditions}</div>
        ))}
        {weatherData.map((wd) => (
          <div key={wd.day}>{wd.day}</div>
        ))}
      </div>
    </div>
  );
}
